import React from "react";
import './index.css';

class Nav extends React.Component{
    constructor(){
        super()
    }
    //methods od each react`s component for depicting template
    render(){
        const {menu} = this.props 
        return (
            <div>
                <article className="menu">   
                    <h1>Nav</h1>
                    <ul>
                    {
                        menu.map((item, i) => 
                            <li key={i}>
                                <a href={item.link}>{item.text}</a>
                            </li>
                        )
                    }
                    </ul>
                </article>
            </div>
        )
    }
}


export default Nav;
